import React from 'react';
import MenuBar from './components/menubar/Menu'
import { createMuiTheme, ThemeProvider } from '@material-ui/core/styles';

const theme = createMuiTheme({
    palette: {
      primary: {        
        main: '#424242',
        dark: '#1b1b1b',
        light: '#6d6d6d',
        contrastText: '#ffffff',
      },
      secondary: {
        light: '#ff5f52',
        main: '#c62828',
        dark: '#8e0000',
        contrastText: '#ffffff',
      },
      // error: will use the default color
    },
    typography: {
      fontFamily: [
        'Big John PRO',
      ].join(','),
      '&:hover': {
        color: '#c62828',
        opacity: 1,
      },
    },

  });

function App() {
  return (
    <ThemeProvider theme={theme}>
      <MenuBar theme={theme}></MenuBar>
    </ThemeProvider>
  );
}

export default App;
